'as',
'  c_group_membership_collection_name constant varchar2(16) := ''GROUP_MEMBERSHIP'';',
'  l_group_membership apex_t_varchar2;',
'begin',
'  --:G_NAME := apex_json.get_varchar2(''given_name'') || '' '' || apex_json.get_varchar2(''family_name'');',
