,p_source_type=>'NATIVE_SQL_REPORT'
,p_query_type=>'SQL'
,p_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT  M.DBID,',
'        null LINK_CLASS,',
'        apex_page.get_url(p_items => ''P30_DBID'', p_values => M.DBID) LINK,        ',
'        ''fa fa-list-alt'' ICON_CLASS,',
'        null LINK_ATTR,',
'        null ICON_COLOR_CLASS,   ',
'        CASE WHEN COALESCE(:P30_DBID, ''0'') = M.DBID',
'            then ''is-active'' ',
'            else '' ''',
'        end LIST_CLASS,',
'        (SUBSTR(A.ACCOUNT_NAME, 1, 50) ||( CASE WHEN LENGTH(A.ACCOUNT_NAME) > 50 THEN ''...'' ELSE '''' END )) LIST_TITLE,    ',
'        M.MEMO LIST_TEXT,',
'        M.STATUS LIST_BADGE   ',
'FROM    MAIN_INVOICE M, ACCOUNT_PAYABLE A',
'WHERE   M.BILL_TO_ACCOUNT_DBID = A.DBID                 ',
'AND     NVL(M.MONEY_TRANSFER_FLAG,1) = 0',
'AND     M.STATUS <> -1',
'ORDER BY M.INVOICE_DATE ASC'))
,p_ajax_enabled=>'Y'
,p_ajax_items_to_submit=>'P30_SEARCH'
