'    WHERE   DBID = :P310_DBID;',
'',
'    IF items_exist > 0 THEN',
'        ',
'        SELECT  SUM(AMOUNT * QUANTITY) INTO total',
'        FROM    INVOICE_LIST ',
'        WHERE   :P310_DBID = MAIN_INVOICE_DBID;',
'',
'        new_date := TO_DATE(:P310_INVOICE_DATE, ''DD-MON-YYYY'');',
'        new_due := new_date + term;',
'        --new_due := TO_DATE(:P310_INVOICE_DATE, ''DD-MON-YYYY'');',
'',
'        -- CLEAR ALL INVOICES THAT HAVE NOTE BEEN SENT OUT YET',
'        DELETE FROM BILL',
'        WHERE   INVOICE_DBID = :P310_DBID',
'        AND     TRUNC(BILLING_DATE) >= TRUNC(SYSDATE);',
'',
'        IF :P310_INVOICE_TYPE = ''ADHOC'' THEN',
'            INSERT INTO INVOICE',
'            (MAIN_INVOICE_DBID, INVOICE_DATE, AMOUNT_DUE, INVOICE_DUE_DATE, STATUS)',
'            VALUES',
'            (:P310_DBID, new_date, total,new_due,0);',
'        END IF;',
'',
'        IF :P310_INVOICE_TYPE = ''MONTHLY'' THEN',
'            WHILE (billing_end >= new_date)',
'            LOOP',
'                -- Only create invoice if the invoice date is or ahead of today''s date',
'                IF TRUNC(new_date) >= TRUNC(SYSDATE) THEN',
'                    INSERT INTO INVOICE',
'                    (MAIN_INVOICE_DBID, INVOICE_DATE, AMOUNT_DUE, INVOICE_DUE_DATE,STATUS)',
'                    VALUES   ',
'                    (:P310_DBID, new_date, total, new_due , 0);',
'                END IF;',
'                new_date := ADD_MONTHS(new_date, 1);',
'                new_due := new_date + term;',
'',
'            END LOOP;',
'',
'        END IF;',
'',
'        -- Update Status to 1 once bills are generated',
'        UPDATE  MAIN_INVOICE',
'        SET     STATUS = 2',
'        WHERE   DBID = :P310_DBID;',
'',
'    END IF;',
'',
'    ',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when=>'APPROVE'
,p_process_when_type=>'REQUEST_IN_CONDITION'
);
