,p_computation_type=>'QUERY'
,p_computation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT  P.EMAIL PI_EMAIL',
'FROM    INVOICE I, MAIN_INVOICE M, CONTACT P',
'WHERE   I.DBID = :P360_DBID',
'AND     M.DBID = I.MAIN_INVOICE_DBID',
'AND     P.DBID = M.BILL_TO_CONTACT_DBID'))
,p_compute_when=>'P360_DBID'
,p_compute_when_type=>'ITEM_IS_NOT_NULL'
);
wwv_flow_imp_page.create_page_computation(
 p_id=>wwv_flow_imp.id(32538966171464598)
,p_computation_sequence=>20
,p_computation_item=>'P360_INVOICE_NUMBER'
,p_computation_point=>'BEFORE_BOX_BODY'
,p_computation_type=>'FUNCTION_BODY'
,p_computation_language=>'PLSQL'
,p_computation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    year_exists     NUMBER;',
'    current_year    NUMBER;',
'    max_invoice     NUMBER;',
'',
'BEGIN',
'',
'    SELECT  TO_NUMBER(TO_CHAR(SYSDATE,''YYYY'')) INTO current_year',
'    FROM    DUAL;',
'',
'    SELECT  COUNT(*) INTO year_exists',
'    FROM    INVOICE I, MAIN_INVOICE M',
'    WHERE   I.MAIN_INVOICE_DBID = M.DBID',
'    AND     M.MONEY_TRANSFER_FLAG = 0',
'    AND     FLOOR(I.INVOICE_NUMBER/1000000) = current_year;',
'',
'',
'    SELECT  MAX(I.INVOICE_NUMBER) INTO max_invoice',
'    FROM    INVOICE I, MAIN_INVOICE M',
'    WHERE   I.MAIN_INVOICE_DBID = M.DBID',
'    AND     M.MONEY_TRANSFER_FLAG = 0',
'    AND     FLOOR(I.INVOICE_NUMBER/1000000) = current_year;',
'',
'',
'    -- Check if invoice number for this year already exists',
'    IF  year_exists = 0 THEN',
'        RETURN TO_NUMBER(current_year || LPAD(1,6,''0''));',
'    ELSE    ',
'        RETURN max_invoice + 1;',
'    END IF;',
'',
'END;'))
,p_compute_when=>'P360_STATUS'
,p_compute_when_text=>'0'
,p_compute_when_type=>'VAL_OF_ITEM_IN_COND_EQ_COND2'
);
wwv_flow_imp_page.create_page_computation(
 p_id=>wwv_flow_imp.id(32662406482099877)
,p_computation_sequence=>30
,p_computation_item=>'P360_INVOICE_DUE_DATE'
,p_computation_point=>'BEFORE_BOX_BODY'
,p_computation_type=>'FUNCTION_BODY'
,p_computation_language=>'PLSQL'
,p_computation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    term NUMBER;',
'',
'BEGIN',
'',
'    SELECT  PAYMENT_TERM INTO term',
'    FROM    MAIN_INVOICE',
'    WHERE   DBID = :P360_MAIN_INVOICE_DBID;',
'',
'    RETURN TO_CHAR(TO_DATE(:P360_INVOICE_DUE_DATE,''DD-MON-YYYY'') + term, ''DD-MON-YYYY'');',
'',
'END;'))
,p_compute_when=>'P360_STATUS'
,p_compute_when_text=>'0'
,p_compute_when_type=>'VAL_OF_ITEM_IN_COND_EQ_COND2'
);
