,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    unpaid_bills    NUMBER;',
'    paid_bills      NUMBER;',
'',
'BEGIN',
'',
'    SELECT  COUNT(*) INTO unpaid_bills',
'    FROM    INVOICE',
'    WHERE   MAIN_INVOICE_DBID = :P400_MAIN_INVOICE_DBID',
'    AND     STATUS < 2;',
'',
'    SELECT  COUNT(*) INTO paid_bills',
'    FROM    INVOICE',
'    WHERE   MAIN_INVOICE_DBID = :P400_MAIN_INVOICE_DBID',
'    AND     STATUS = 2;',
'',
'    --Update invoice to Active when there is atleast one bill found',
'    IF paid_bills = 1 THEN',
'        UPDATE  MAIN_INVOICE',
'        SET     STATUS = 3',
'        WHERE   DBID = :P400_MAIN_INVOICE_DBID;',
'    END IF; ',
'',
'    --Update invoice to Fulfilled when no no unpaid bills found',
'    ',
'    IF unpaid_bills = 0 THEN',
'        UPDATE  MAIN_INVOICE',
'        SET     STATUS = 4',
'        WHERE   DBID = :P400_MAIN_INVOICE_DBID;',
'    END IF;',
'',
'END;'))
,p_process_clob_language=>'PLSQL'
