wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(32803000688841129)
,p_process_sequence=>40
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'Create Invoices'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    total       NUMBER;',
'    new_date    DATE;',
'    new_due     DATE;',
'    billing_end DATE := TO_DATE(:P1010_BILLING_PERIOD_END_DATE, ''DD-MON-YYYY'');',
'    term        NUMBER;',
'',
'BEGIN',
'    SELECT  PAYMENT_TERM into term',
'    FROM    MAIN_INVOICE',
'    WHERE   DBID = :P1010_DBID;',
'    ',
'    SELECT  CONTROL_TOTAL_AMOUNT INTO total',
'    FROM    MAIN_INVOICE',
'    WHERE   DBID = :P1010_DBID;',
'',
'    new_date := TO_DATE(:P1010_INVOICE_DATE, ''DD-MON-YYYY'');',
'    new_due := new_date + term;',
'    --new_due := TO_DATE(:P1010_INVOICE_DATE, ''DD-MON-YYYY'');',
'',
'    -- CLEAR ALL INVOICES THAT HAVE NOTE BEEN SENT OUT YET',
'    DELETE FROM BILL',
'    WHERE   INVOICE_DBID = :P1010_DBID',
'    AND     TRUNC(BILLING_DATE) >= TRUNC(SYSDATE);',
'',
'    IF :P1010_INVOICE_TYPE = ''ADHOC'' THEN',
'        INSERT INTO INVOICE',
'        (MAIN_INVOICE_DBID, INVOICE_DATE, AMOUNT_DUE, INVOICE_DUE_DATE, STATUS)',
'        VALUES',
'        (:P1010_DBID, new_date, total,new_due,0);',
'    END IF;',
'',
'    IF :P1010_INVOICE_TYPE = ''MONTHLY'' THEN',
'        WHILE (billing_end >= new_date)',
'        LOOP',
'            -- Only create invoice if the invoice date is or ahead of today''s date',
'            IF TRUNC(new_date) >= TRUNC(SYSDATE) THEN',
'                INSERT INTO INVOICE',
'                (MAIN_INVOICE_DBID, INVOICE_DATE, AMOUNT_DUE, INVOICE_DUE_DATE,STATUS)',
'                VALUES   ',
'                (:P1010_DBID, new_date, total, new_due , 0);',
'            END IF;',
'            new_date := ADD_MONTHS(new_date, 1);',
'            new_due := new_date + term;',
'',
'        END LOOP;',
'',
'    END IF;',
'',
'    IF :P1010_INVOICE_TYPE = ''QUARTERLY'' THEN',
'        WHILE (billing_end >= new_date)',
'        LOOP',
'            -- Only create invoice if the invoice date is or ahead of today''s date',
'            IF TRUNC(new_date) >= TRUNC(SYSDATE) THEN',
'                INSERT INTO INVOICE',
'                (MAIN_INVOICE_DBID, INVOICE_DATE, AMOUNT_DUE, INVOICE_DUE_DATE,STATUS)',
'                VALUES   ',
'                (:P1010_DBID, new_date, total, new_due , 0);',
'            END IF;',
'            new_date := ADD_MONTHS(new_date, 3);',
'            new_due := new_date + term;',
'',
'        END LOOP;',
'',
'    END IF;',
'',
'    IF :P1010_INVOICE_TYPE = ''SEMIANNUALLY'' THEN',
'        WHILE (billing_end >= new_date)',
'        LOOP',
'            -- Only create invoice if the invoice date is or ahead of today''s date',
'            IF TRUNC(new_date) >= TRUNC(SYSDATE) THEN',
'                INSERT INTO INVOICE',
'                (MAIN_INVOICE_DBID, INVOICE_DATE, AMOUNT_DUE, INVOICE_DUE_DATE,STATUS)',
'                VALUES   ',
'                (:P1010_DBID, new_date, total, new_due , 0);',
'            END IF;',
'            new_date := ADD_MONTHS(new_date, 6);',
'            new_due := new_date + term;',
'',
'        END LOOP;',
'',
'    END IF;       ',
'',
'    IF :P1010_INVOICE_TYPE = ''ANNUALLY'' THEN',
'        WHILE (billing_end >= new_date)',
'        LOOP',
'            -- Only create invoice if the invoice date is or ahead of today''s date',
'            IF TRUNC(new_date) >= TRUNC(SYSDATE) THEN',
'                INSERT INTO INVOICE',
'                (MAIN_INVOICE_DBID, INVOICE_DATE, AMOUNT_DUE, INVOICE_DUE_DATE,STATUS)',
'                VALUES   ',
'                (:P1010_DBID, new_date, total, new_due , 0);',
'            END IF;',
'            new_date := ADD_MONTHS(new_date, 12);',
'            new_due := new_date + term;',
'',
'        END LOOP;',
'',
'    END IF;                ',
'',
'    -- Update Status to 1 once bills are generated',
'    UPDATE  MAIN_INVOICE',
'    SET     STATUS = 2',
'    WHERE   DBID = :P1010_DBID;',
'',
'',
'    ',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when=>'APPROVE'
,p_process_when_type=>'REQUEST_IN_CONDITION'
);
end;
