 p_id=>wwv_flow_imp.id(32896550233396268)
,p_computation_sequence=>20
,p_computation_item=>'P1060_INVOICE_NUMBER'
,p_computation_point=>'BEFORE_BOX_BODY'
,p_computation_type=>'FUNCTION_BODY'
,p_computation_language=>'PLSQL'
,p_computation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    year_exists     NUMBER;',
'    current_year    NUMBER;',
'    max_invoice     NUMBER;',
'',
'BEGIN',
'',
'    SELECT  TO_NUMBER(TO_CHAR(SYSDATE,''YYYY'')) INTO current_year',
'    FROM    DUAL;',
'',
'    SELECT  COUNT(*) INTO year_exists',
'    FROM    INVOICE I, MAIN_INVOICE M',
'    WHERE   I.MAIN_INVOICE_DBID = M.DBID',
