'',
'',
'    SELECT  MAX(I.INVOICE_NUMBER) INTO max_invoice',
'    FROM    INVOICE I, MAIN_INVOICE M',
'    WHERE   I.MAIN_INVOICE_DBID = M.DBID',
'    AND     M.MONEY_TRANSFER_FLAG = 0',
'    AND     FLOOR(I.INVOICE_NUMBER/1000000) = current_year;',
'',
'',
'    -- Check if invoice number for this year already exists',
'    IF  year_exists = 0 THEN',
'        RETURN TO_NUMBER(current_year || LPAD(1,6,''0''));',
'    ELSE    ',
'        RETURN max_invoice + 1;',
'    END IF;',
'',
'END;'))
